import React, {useEffect} from "react";
import KittenCard from "./KittenCard";

function Home({kittenImg, setKittenImg}) {

    useEffect(() => {
        fetch("http://localhost:3000/kittens")
        .then(response => response.json())
        .then(data => setKittenImg(data.image))
      })

    return (
        <KittenCard kittenImg={kittenImg} />
    )
}

export default Home;
